import React from 'react';
import { useHistory } from 'react-router-dom';

const home = (props) => {
    const history = useHistory;
    return (
        <>
            <h1>home</h1>
            <button onClick={()=>{
                history.push("/home");
            }}>
                go to profile
            </button>
        </>
    )
};     

export default home;
